#version 100

uniform 	vec4 _Time;
uniform 	vec4 hlslcc_mtx4x4unity_ObjectToWorld[4];
uniform 	vec4 hlslcc_mtx4x4unity_MatrixVP[4];
uniform 	vec4 _MainTex_ST;
uniform 	vec4 _MaskTex_ST;
uniform 	float _Image01_X_Speed;
uniform 	float _Image01_Y_Speed;
uniform 	float _Image02_X_Speed;
uniform 	float _Image02_Y_Speed;
attribute highp vec4 in_POSITION0;
attribute highp vec4 in_COLOR0;
attribute highp vec2 in_TEXCOORD0;
varying highp vec4 vs_COLOR0;
varying highp vec2 vs_TEXCOORD0;
varying highp vec2 vs_TEXCOORD1;
vec4 u_xlat0;
vec4 u_xlat1;
void main()
{
    u_xlat0 = in_POSITION0.yyyy * hlslcc_mtx4x4unity_ObjectToWorld[1];
    u_xlat0 = hlslcc_mtx4x4unity_ObjectToWorld[0] * in_POSITION0.xxxx + u_xlat0;
    u_xlat0 = hlslcc_mtx4x4unity_ObjectToWorld[2] * in_POSITION0.zzzz + u_xlat0;
    u_xlat0 = u_xlat0 + hlslcc_mtx4x4unity_ObjectToWorld[3];
    u_xlat1 = u_xlat0.yyyy * hlslcc_mtx4x4unity_MatrixVP[1];
    u_xlat1 = hlslcc_mtx4x4unity_MatrixVP[0] * u_xlat0.xxxx + u_xlat1;
    u_xlat1 = hlslcc_mtx4x4unity_MatrixVP[2] * u_xlat0.zzzz + u_xlat1;
    gl_Position = hlslcc_mtx4x4unity_MatrixVP[3] * u_xlat0.wwww + u_xlat1;
    vs_COLOR0 = in_COLOR0;
    u_xlat0.xy = in_TEXCOORD0.xy * _MainTex_ST.xy + _MainTex_ST.zw;
    vs_TEXCOORD0.xy = (-_Time.xx) * vec2(_Image01_X_Speed, _Image01_Y_Speed) + u_xlat0.xy;
    u_xlat0.xy = in_TEXCOORD0.xy * _MaskTex_ST.xy + _MaskTex_ST.zw;
    vs_TEXCOORD1.xy = (-_Time.xx) * vec2(_Image02_X_Speed, _Image02_Y_Speed) + u_xlat0.xy;
    return;
}


#version 100

#ifdef GL_FRAGMENT_PRECISION_HIGH
    precision highp float;
#else
    precision mediump float;
#endif
precision highp int;
uniform 	vec4 _TintColor;
uniform 	float _Image01_Brightness;
uniform 	float _Alpha;
uniform lowp sampler2D _MainTex;
uniform lowp sampler2D _MaskTex;
varying highp vec4 vs_COLOR0;
varying highp vec2 vs_TEXCOORD0;
varying highp vec2 vs_TEXCOORD1;
#define SV_TARGET0 gl_FragData[0]
vec3 u_xlat0;
lowp float u_xlat10_0;
lowp vec4 u_xlat10_1;
void main()
{
    u_xlat10_0 = texture2D(_MaskTex, vs_TEXCOORD1.xy).x;
    u_xlat0.x = u_xlat10_0 * _Alpha;
    u_xlat0.x = u_xlat0.x * vs_COLOR0.w;
    u_xlat10_1 = texture2D(_MainTex, vs_TEXCOORD0.xy);
    SV_TARGET0.w = u_xlat0.x * u_xlat10_1.w;
    u_xlat0.xyz = u_xlat10_1.xyz * vec3(_Image01_Brightness);
    u_xlat0.xyz = u_xlat0.xyz * _TintColor.xyz;
    SV_TARGET0.xyz = u_xlat0.xyz * vs_COLOR0.xyz;
    return;
}
